import React from 'react';

const FollowerList = props => {

    console.log();

    return (
    <div className='followers'>
        {props.gitHubFollowers.map(follower => (
            <div>
                <img width="100" src={follower.avatar_url} alt={follower.login}/>
                <p>{follower.login}</p>
            </div>
        ))}
    </div>
    )
}

export default FollowerList;
